// And groups predicates with the AND operator between them.
func And(predicates ...predicate.StandardInvoiceSettlement) predicate.StandardInvoiceSettlement {
	return predicate.StandardInvoiceSettlement(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.StandardInvoiceSettlement) predicate.StandardInvoiceSettlement {
	return predicate.StandardInvoiceSettlement(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.StandardInvoiceSettlement) predicate.StandardInvoiceSettlement {
	return predicate.StandardInvoiceSettlement(sql.NotPredicates(p))
}
